BEGIN TRANSACTION;
CREATE TABLE augment_tiers (
            augment_api_name TEXT NOT NULL,
            version TEXT,
            op_tier TEXT,
            PRIMARY KEY (augment_api_name, version)
        );
CREATE TABLE augments (
            api_name TEXT NOT NULL,
            version TEXT,
            name TEXT,
            desc TEXT,
            icon TEXT,
            associated_traits_json TEXT,
            effects_json TEXT,
            raw_json TEXT,
            PRIMARY KEY (api_name, version)
        );
CREATE TABLE champion_stats (
            character_id TEXT NOT NULL,
            version TEXT,
            queue_id TEXT,
            is_mode INTEGER,
            total_count INTEGER,
            win_count INTEGER,
            top4_count INTEGER,
            win_rate REAL,
            top4_rate REAL,
            avg_placement REAL,
            PRIMARY KEY (character_id, version, queue_id, is_mode)
        );
CREATE TABLE champions (
            api_name TEXT NOT NULL,
            version TEXT,
            name TEXT,
            cost INTEGER,
            role TEXT,
            icon TEXT,
            square_icon TEXT,
            tile_icon TEXT,
            traits_json TEXT,
            stats_json TEXT,
            ability_json TEXT,
            raw_json TEXT,
            PRIMARY KEY (api_name, version)
        );
CREATE TABLE comps (
            comp_id TEXT NOT NULL,
            version TEXT,
            name TEXT,
            level INTEGER,
            difficulty TEXT,
            tags_json TEXT,
            avg_placement REAL,
            first_rate REAL,
            top4_rate REAL,
            pick_rate REAL,
            match_count INTEGER,
            traits_json TEXT,
            units_json TEXT,
            detail_url TEXT,
            team_code TEXT,
            raw_json TEXT,
            PRIMARY KEY (comp_id, version)
        );
CREATE TABLE item_stats (
            item_api_name TEXT NOT NULL,
            version TEXT,
            avg_placement REAL,
            total_count INTEGER,
            win_count INTEGER,
            top4_count INTEGER,
            win_rate REAL,
            top4_rate REAL,
            champions_json TEXT,
            PRIMARY KEY (item_api_name, version)
        );
CREATE TABLE items (
            api_name TEXT NOT NULL,
            version TEXT,
            name TEXT,
            item_type TEXT,
            icon TEXT,
            from_json TEXT,
            effects_json TEXT,
            raw_json TEXT,
            PRIMARY KEY (api_name, version)
        );
CREATE TABLE recommend_items (
            character_id TEXT NOT NULL,
            version TEXT,
            item_names_json TEXT,
            item_count INTEGER,
            total_champion_count INTEGER,
            win_count INTEGER,
            win_rate REAL,
            top4_count INTEGER,
            top4_rate REAL,
            avg_placement REAL,
            PRIMARY KEY (character_id, version, item_names_json)
        );
CREATE TABLE run_info (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            fetched_at TEXT NOT NULL,
            locale TEXT NOT NULL,
            source TEXT NOT NULL
        );
CREATE TABLE trait_stats (
            trait_api_name TEXT NOT NULL,
            version TEXT,
            avg_placement REAL,
            total_count INTEGER,
            win_count INTEGER,
            top4_count INTEGER,
            win_rate REAL,
            top4_rate REAL,
            style INTEGER,
            backend_style INTEGER,
            custom_style INTEGER,
            display_num_units INTEGER,
            PRIMARY KEY (trait_api_name, version, display_num_units)
        );
CREATE TABLE traits (
            api_name TEXT NOT NULL,
            version TEXT,
            name TEXT,
            category TEXT,
            icon TEXT,
            desc TEXT,
            effects_json TEXT,
            raw_json TEXT,
            PRIMARY KEY (api_name, version)
        );
DELETE FROM "sqlite_sequence";
COMMIT;
