INSERT INTO "traits" VALUES('TFT16_HexMech','16.2','HexMech','origin','ASSETS/UX/TraitIcons/Trait_Icon_16_Hexmech.TFT_Set16.tex','Gain a Pilot Hex. Combat Start: the unit within jumps into T-Hex, granting her 80% of their Health and bonus stats based on their role and star level.<br><br><TFTBonus>Tank:</TFTBonus> +15/25/40% Omnivamp<br><TFTBonus>Fighter:</TFTBonus> +15/25/40% Attack Damage<br><TFTBonus>Marksman:</TFTBonus> +10/18/30% Damage Amp<br><TFTBonus>Caster:</TFTBonus> +3/6/12 Mana Regen<br><TFTBonus>Assassin:</TFTBonus> +30/60/100% Crit Chance<br>','[{"maxUnits":25000,"minUnits":1,"style":4,"variables":{"AD1":15,"AD2":25,"AD3":40,"Amp1":10,"Amp2":18,"Amp3":30,"Crit1":30,"Crit2":60,"Crit3":100,"Mana1":3,"Mana2":6,"Mana3":12,"PercentHealth":0.8,"StunDuration":1.5,"Vamp1":15,"Vamp2":25,"Vamp3":40,"undefined":0.5}}]','{"apiName":"TFT16_HexMech","desc":"Gain a Pilot Hex. Combat Start: the unit within jumps into T-Hex, granting her 80% of their Health and bonus stats based on their role and star level.<br><br><TFTBonus>Tank:</TFTBonus> +15/25/40% Omnivamp<br><TFTBonus>Fighter:</TFTBonus> +15/25/40% Attack Damage<br><TFTBonus>Marksman:</TFTBonus> +10/18/30% Damage Amp<br><TFTBonus>Caster:</TFTBonus> +3/6/12 Mana Regen<br><TFTBonus>Assassin:</TFTBonus> +30/60/100% Crit Chance<br>","effects":[{"maxUnits":25000,"minUnits":1,"style":4,"variables":{"AD1":15,"AD2":25,"AD3":40,"Amp1":10,"Amp2":18,"Amp3":30,"Crit1":30,"Crit2":60,"Crit3":100,"Mana1":3,"Mana2":6,"Mana3":12,"PercentHealth":0.8,"StunDuration":1.5,"Vamp1":15,"Vamp2":25,"Vamp3":40,"undefined":0.5}}],"icon":"ASSETS/UX/TraitIcons/Trait_Icon_16_Hexmech.TFT_Set16.tex","name":"HexMech","org":{"desc":"Gain a Pilot Hex. Combat Start: the unit within jumps into T-Hex, granting her @PercentHealth*100@% of their Health and bonus stats based on their role and star level.<br><br><TFTBonus>Tank:</TFTBonus> +@Vamp1@/@Vamp2@/@Vamp3@% Omnivamp<br><TFTBonus>Fighter:</TFTBonus> +@AD1@/@AD2@/@AD3@% Attack Damage<br><TFTBonus>Marks