INSERT INTO "traits" VALUES('TFT16_Void','16.2','Void','origin','ASSETS/UX/TraitIcons/Trait_Icon_16_Void.TFT_Set16.tex','Gain Mutations that only Void champions can use. Void champions gain Attack&nbsp;Speed.<br>','[{"maxUnits":3,"minUnits":2,"style":1,"variables":{"BonusAS":0.08,"NumMutations":1,"SuperchargedMult":null}},{"maxUnits":5,"minUnits":4,"style":3,"variables":{"BonusAS":0.18,"NumMutations":2,"undefined":null}},{"maxUnits":8,"minUnits":6,"style":4,"variables":{"BonusAS":0.33,"NumMutations":3,"SuperchargedMult":null}},{"maxUnits":25000,"minUnits":9,"style":4,"variables":{"BonusAS":0.4,"NumMutations":3,"SuperchargedMult":1}}]','{"apiName":"TFT16_Void","desc":"Gain Mutations that only Void champions can use. Void champions gain Attack&nbsp;Speed.<br>","effects":[{"maxUnits":3,"minUnits":2,"style":1,"variables":{"BonusAS":0.08,"NumMutations":1,"SuperchargedMult":null}},{"maxUnits":5,"minUnits":4,"style":3,"variables":{"BonusAS":0.18,"NumMutations":2,"undefined":null}},{"maxUnits":8,"minUnits":6,"style":4,"variables":{"BonusAS":0.33,"NumMutations":3,"SuperchargedMult":null}},{"maxUnits":25000,"minUnits":9,"style":4,"variables":{"BonusAS":0.4,"NumMutations":3,"SuperchargedMult":1}}],"icon":"ASSETS/UX/TraitIcons/Trait_Icon_16_Void.TFT_Set16.tex","name":"Void","org":{"desc":"Gain Mutations that only Void champions can use. Void champions gain Attack&nbsp;Speed.<br><br><row>(@MinUnits@) @NumMutations@ Mutation, @BonusAS*100@%&nbsp;%i:scaleAS%</row><br><row>(@MinUnits@) @NumMutations@ Mutations, @BonusAS*100@%&nbsp;%i:scaleAS%</row><br><row>(@MinUnits@) @NumMutations@ Mutations, @BonusAS*100@%&nbsp;%i:scaleAS%</row><br><row>(@MinUnits@) Mutations become supercharged, increasing their power by @SuperchargedMult*100@%. @BonusAS*100@%&nbsp;%i:scaleAS%</row><br><br><rules>Champions can only have one Mutation at a time. Benching a champion removes their&nbsp;Mutation.</rules><br>","effects":[{"maxUnits":3,"minUnits":2,"style":1,"variables":{"BonusAS":0.07999999821186066,