INSERT INTO "traits" VALUES('TFT16_TheBoss','16.2','The Boss','origin','ASSETS/UX/TraitIcons/Trait_Icon_4_Theboss.tex','When Sett first drops below 45% max Health, he leaves combat to start doing sit-ups. Each sit-up restores 15% max Health and gives him 60% Attack and Move Speed.<br>','[{"maxUnits":25000,"minUnits":1,"style":4,"variables":{"AttackSpeedPercent":60,"HealPercent":15,"MaxHealthThreshold":0.45}}]','{"apiName":"TFT16_TheBoss","desc":"When Sett first drops below 45% max Health, he leaves combat to start doing sit-ups. Each sit-up restores 15% max Health and gives him 60% Attack and Move Speed.<br>","effects":[{"maxUnits":25000,"minUnits":1,"style":4,"variables":{"AttackSpeedPercent":60,"HealPercent":15,"MaxHealthThreshold":0.45}}],"icon":"ASSETS/UX/TraitIcons/Trait_Icon_4_Theboss.tex","name":"The Boss","org":{"desc":"When Sett first drops below @MaxHealthThreshold*100@% max Health, he leaves combat to start doing sit-ups. Each sit-up restores @HealPercent@% max Health and gives him @AttackSpeedPercent@% Attack and Move Speed.<br><br>If he reaches full Health, he returns to combat Pumped Up, converting all damage from his attacks and Ability to true damage. If all of his allies die, he immediately returns to combat.","effects":[{"maxUnits":25000,"minUnits":1,"style":4,"variables":{"AttackSpeedPercent":60,"HealPercent":15,"MaxHealthThreshold":0.44999998807907104}}]},"_key":"TFT16_TheBoss","imageUrl":"https://c-tft-api.op.gg/img/set/16/tft-trait/Trait_Icon_4_Theboss.png","champions":[{"apiName":"TFT16_Sett","name":"Sett"}],"category":"origin","removeSpaceName":"TheBoss"}');
