INSERT INTO "traits" VALUES('TFT16_Harvester','16.2','Harvester','origin','ASSETS/UX/TraitIcons/Trait_Icon_16_Harvester.TFT_Set16.tex','Each time an enemy champion dies, gain 10 Mana. Casting abilities does not consume Mana. <br>','[{"maxUnits":25000,"minUnits":1,"style":4,"variables":{"EnemyArmorMRReduction":10,"ManaPerEnemyDeath":10}}]','{"apiName":"TFT16_Harvester","desc":"Each time an enemy champion dies, gain 10 Mana. Casting abilities does not consume Mana. <br>","effects":[{"maxUnits":25000,"minUnits":1,"style":4,"variables":{"EnemyArmorMRReduction":10,"ManaPerEnemyDeath":10}}],"icon":"ASSETS/UX/TraitIcons/Trait_Icon_16_Harvester.TFT_Set16.tex","name":"Harvester","org":{"desc":"Each time an enemy champion dies, gain @ManaPerEnemyDeath@ Mana. Casting abilities does not consume Mana. <br><br>All enemies lose @EnemyArmorMRReduction@ Armor and Magic Resist.","effects":[{"maxUnits":25000,"minUnits":1,"style":4,"variables":{"EnemyArmorMRReduction":10,"ManaPerEnemyDeath":10}}]},"_key":"TFT16_Harvester","imageUrl":"https://c-tft-api.op.gg/img/set/16/tft-trait/Trait_Icon_16_Harvester.TFT_Set16.png","champions":[{"apiName":"TFT16_Fiddlesticks","name":"Fiddlesticks"}],"category":"origin","removeSpaceName":"Harvester"}');
INSERT INTO "traits" VALUES('TFT16_ZaahenTrait','16.2','Immortal','origin','ASSETS/UX/TraitIcons/Trait_Icon_16_Immortal.TFT_Set16.tex','While Xin Zhao is not on your board, Zaahen gains the Ionia, Demacia, and Warden traits.<br>','[{"maxUnits":25000,"minUnits":1,"style":4,"variables":{"FocusNeededToRevive":3,"PercentMaxHealthHeal":0.6,"ReviveDuration":0.5,"undefined":null}}]','{"apiName":"TFT16_ZaahenTrait","desc":"While Xin Zhao is not on your board, Zaahen gains the Ionia, Demacia, and Warden traits.<br>","effects":[{"maxUnits":25000,"minUnits":1,"style":4,"variables":{"FocusNeededToRevive":3,"PercentMaxHealthHeal":0.6,"ReviveDuration":0.5,"undefined":null}}],"icon":"ASSETS/UX/TraitIcons/Trait_Icon_16_Immortal.TFT_Set16.tex","name":"Immortal","org":{"desc":"While Xin Zhao is not on your board, Zaahen gains the Ionia, Demacia, and Warden traits.<br><br>On kill, Zaahen gains a stack of Determination for the rest of combat. If he has @FocusNeededToRevive@ or more Determination when dying, he spends it to revive and restore @PercentMaxHealthHeal*100@%&nbsp;max&nbsp;Health.","effects":[{"maxUnits":25000,"minUnits":1,"style":4,"variables":{"FocusNeededToRevive":3,"PercentMaxHealthHeal":0.6000000238418579,"ReviveDuration":0.5,"{54747e02}":null}}]},"_key":"TFT16_ZaahenTrait","imageUrl":"https://c-tft-api.op.gg/img/set/16/tft-trait/Trait_Icon_16_Immortal.TFT_Set16.png","champions":[{"apiName":"TFT16_Zaahen","name":"Zaahen"}],"category":"origin","removeSpaceName":"Immortal"}');
INSERT INTO "traits" VALUES('TFT16_Heroic','16.2','Heroic','origin','ASSETS/UX/TraitIcons/Trait_Icon_16_Heroic.TFT_Set16.tex','Galio cannot be fielded in combat. Instead, his traits count from the bench and when Demacians Rally, he joins the fight. <br>','[{"maxUnits":25000,"minUnits":1,"style":4,"variables":{"HexRadius":3,"KnockupDuration":1,"PercentMaxHP":0.1}}]','{"apiName":"TFT16_Heroic","desc":"Galio cannot be fielded in combat. Instead, his traits count from the bench and when Demacians Rally, he joins the fight. <br>","effects":[{"maxUnits":25000,"minUnits":1,"style":4,"variables":{"HexRadius":3,"KnockupDuration":1,"PercentMaxHP":0.1}}],"icon":"ASSETS/UX/TraitIcons/Trait_Icon_16_Heroic.TFT_Set16.tex","name":"Heroic","org":{"desc":"Galio cannot be fielded in combat. Instead, his traits count from the bench and when Demacians Rally, he joins the fight. <br><br>On landing, he creates a @HexRadius@-hex shockwave that deals @PercentMaxHP*100@% of his max Health as magic damage. Enemies hit are knocked up for @KnockupDuration@ seconds, reduced by distance from the center.","effects":[{"maxUnits":25000,"minUnits":1,"style":4,"variables":{"HexRadius":3,"KnockupDuration":1,"PercentMaxHP":0.10000000149011612}}]},"_key":"TFT16_Heroic","imageUrl":"https://c-tft-api.op.gg/img/set/16/tft-trait/Trait_Icon_16_Heroic.TFT_Set16.png","champions":[{"apiName":"TFT16_Galio","name":"Galio"}],"category":"origin","removeSpaceName":"Heroic"}');
