INSERT INTO "traits" VALUES('TFT16_Chronokeeper','16.2','Chronokeeper','origin','ASSETS/UX/TraitIcons/Trait_Icon_16_Chronokeeper.TFT_Set16.tex','Every 2 casts, the Chronokeeper stores <TFTBonus>1</TFTBonus> XP. If he has enough stored for you to level up, he transfers you the required&nbsp;XP. <br><br>If you are level 10, he instead gains <TFTBonus>15%</TFTBonus>&nbsp;Damage Amp.<br>','[{"maxUnits":25000,"minUnits":1,"style":4,"variables":{"CastsToGainXP":2,"CastsToGainXPPAIRS":2,"DAGainAtMaxLevel":15,"XPPerCast":1,"undefined":null}}]','{"apiName":"TFT16_Chronokeeper","desc":"Every 2 casts, the Chronokeeper stores <TFTBonus>1</TFTBonus> XP. If he has enough stored for you to level up, he transfers you the required&nbsp;XP. <br><br>If you are level 10, he instead gains <TFTBonus>15%</TFTBonus>&nbsp;Damage Amp.<br>","effects":[{"maxUnits":25000,"minUnits":1,"style":4,"variables":{"CastsToGainXP":2,"CastsToGainXPPAIRS":2,"DAGainAtMaxLevel":15,"XPPerCast":1,"undefined":null}}],"icon":"ASSETS/UX/TraitIcons/Trait_Icon_16_Chronokeeper.TFT_Set16.tex","name":"Chronokeeper","org":{"desc":"Every @CastsToGainXP@ casts, the Chronokeeper stores <TFTBonus>@XPPerCast@</TFTBonus> XP. If he has enough stored for you to level up, he transfers you the required&nbsp;XP. <br><br>If you are level 10, he instead gains <TFTBonus>@DAGainAtMaxLevel@%</TFTBonus>&nbsp;Damage Amp.<br><br><rules>Stored XP: @TFTUnitProperty.trait:TFT16_ChronoKeeperStoredXP@</rules>","effects":[{"maxUnits":25000,"minUnits":1,"style":4,"variables":{"CastsToGainXP":2,"CastsToGainXPPAIRS":2,"DAGainAtMaxLevel":15,"XPPerCast":1,"{bffe0f35}":null}}]},"_key":"TFT16_Chronokeeper","imageUrl":"https://c-tft-api.op.gg/img/set/16/tft-trait/Trait_Icon_16_Chronokeeper.TFT_Set16.png","champions":[{"apiName":"TFT16_Zilean","name":"Zilean"}],"category":"origin","removeSpaceName":"Chronokeeper"}');
